import React from 'react'

const Blog_nfo = () => {
  return (
    <div>
      <Title/>
      <Panel/>
      <Results/>
    </div>
  )
}

export default Blog_nfo

const Title = () => {
  return (
    <h1 className="text-6xl font-black flex justify-center my-10">My Blog Post</h1>
  )
}

const Panel = () => {
  return (
    <div className='flex justify-center'>
      <button className="bg-purple-600 hover:bg-purple-500 mx-2 py-3 text-[20px] px-8 rounded-lg transition-all">Post</button>
      <button className="bg-purple-600 hover:bg-purple-500 mx-2 py-3 text-[20px] px-8 rounded-lg transition-all">Comments</button>
      <button className="bg-purple-600 hover:bg-purple-500 mx-2 py-3 text-[20px] px-8 rounded-lg transition-all">Users</button>
    </div>
  )
}

const Results = () => {
  return (
    <h3 className="text-3xl mx-16 font-black">Posts</h3>
  )
}
